var receipt = function(data, size) {

    // Data parameter สำหรับใส่ข้อมูลที่จะรับเข้ามา
    // Size parameter สำหรับการกำหนด ขนาดของ กระดาษ
    this.page = zpringSize.page[size];

    var self = this;

    // ถ้าขนาดเอกสาร เป็นแบบ 80m
    if(size === '80m') {

        // โลโก้ตัวอย่าง ไฟล์ภาพ ต้องเป็นรูปแบบ Base64
        var sampleLogo = 'data:image/png;base64,';

        // กำหนด font ของเอกสาร
        this.typeface = new thsarabun();

        // ตั้งค่าคุณสมบัติของ font ในเอกสาร
        this.font = {
            size : 14,
            canvasFont : function(type, size) {
                return utilW.canvasFontName(self.typeface.name, size ? size : self.font.size, type);
            }
        }

        // ตัวอย่าง Object ของ data
        this.data = {
            header : {
                head : {
                    logo : sampleLogo,
                    detail : {
                        receiptTaxID : 'T1-591200147'
                    }
                },
                info : {
                    company : {
                        name : 'บริษัท โปรฟาสซิโน จำกัด สาขา ถนนสุเทพ',
                        taxID : '0735545001470',
                    },
                    receipt : {
                        posID : 'E085000202157',
                        employee : 'น.ส.กรรณิการ์ จันทร์ดีedghijklmpodfkrpopokregpoffff',
                        dateTime : '21/12/2559 19:41'
                    }
                }
            },
            body : {
                order : {
                    orderList : [
                        {
                            detail : {
                                name : 'แซนวิชแฮมชีส'
                            },
                            quantity : {
                                amount : '1'
                            },
                            price : {
                                unit : '20',
                                total : '20'
                            }
                        },
                        {
                            detail : {
                                name : 'ขนมเปี๊ยะชาววังไส้ถั่วคั่วงาดำใส่กะหล่ำปลีกับผักขมอบชีสซอสมะเขือเทศ'
                            },
                            quantity : {
                                amount : '2'
                            },
                            price : {
                                unit : '35',
                                total : '70'
                            }
                        },
                        {
                            detail : {
                                name : 'แซนวิชทูน่าน้ำมันพืชอติลุส185345934-5465'
                            },
                            quantity : {
                                amount : '2'
                            },
                            price : {
                                unit : '35',
                                total : '70'
                            }
                        }
                    ]
                },
                total : {
                    quantity : '2',
                    total : '45345.01',
                    cash : '123.02',
                    change : '4458.00',
                    realTotal : '342.32',
                    tax : '34.22'
                }
            },
            footer : {
                note : 'ทดสอยข้อความ\n ทด ทด ทด อิอิอาหารเม็ดเนื้อนุ่ม เกรดซุปเปอร์พรีเมี่ยมมีสัดส่วนเนื้อในปริมาณสูง ครบคุณค่าทางโภชนาการระดับ โฮลิสติกมีส่วนประกอบของสารอาหารที่เป็นประโยชน์ต่อสุนัข เช่น กลูโคซามีน และคอนดรยติน ซึ่งเป็นสารอาหารจำเป็นต่อการสร้างกระดูกอ่อนและเสริมน้ำเลี้ยงบริเวณข้อต่อ ,เบต้ากลูแคน ที่ช่วยเสริมภูมิคุ้มกันในร่างกาย และที่สำคัญ แร่ลิโมไนซ์ ที่ช่วยดูดซับกลิ่นมูลของสุนัขได้ถึง 80%เหมาะกับสุนัขทุกสายพันธุ์ และโดยเฉพาะสุนัขที่ทานยาก'
            }
        };

        // จับคู่ข้อมูล ให้เข้าเป็น Pattern ที่ระบบต้องการ
        this.dataMap = {
            header : {
                head : {
                    logo : { image : this.data.header.head.logo },
                    detail : {
                        label : { text : 'ใบเสร็จรับเงิน / ใบกำกับภาษี' },
                        receiptTaxID : {
                            label : { text : 'เลขใบกำกับภาษีอย่างย่อ' },
                            value : { text : this.data.header.head.detail.receiptTaxID }
                        },
                    }
                },
                info : {
                    company : {
                        name : { text : this.data.header.info.company.name },
                        taxID : {
                            label : { text : 'เลขประจำตัวผู้เสียภาษี' },
                            value : { text : this.data.header.info.company.taxID }
                        },
                    },
                    receipt : {
                        posID : {
                            label : { text : 'POS ID :' },
                            value : { text : this.data.header.info.receipt.posID }
                        },
                        employee : {
                            label : { text : 'พนง. :' },
                            value : { text : this.data.header.info.receipt.employee }
                        },
                        dateTime : {
                            label : { text : 'วันเวลา :' },
                            value : { text : this.data.header.info.receipt.dateTime }
                        }
                    }
                }
            },
            body : {
                order : {
                    label : { 
                        detail : { text : 'Description', bold: true },
                        quantity : { text : 'Qty', bold: true, alignment: 'right' },
                        price : {
                            unit : { text : 'Price', bold: true, alignment: 'right' },
                            total : { text : 'Amount', bold: true, alignment: 'right' }
                        }
                    },
                    orderList : function() {
                        var newOrder = [];
                        self.data.body.order.orderList.forEach(function(order) {
                            newOrder.push({
                                detail : {
                                    name : { text : order.detail.name },
                                },
                                quantity : {
                                    amount : { text : order.quantity.amount, alignment: 'right' },
                                },
                                price : {
                                    unit : { text : order.price.unit, alignment: 'right' },
                                    total : { text : order.price.total, alignment: 'right' }
                                }
                            });
                        });
                        return newOrder;
                    }()
                },
                total : {
                    quantity : {
                        amount : { text : this.data.body.total.quantity },
                        unit : { text : 'ชิ้น' }
                    },
                    total : {
                        label : { text : 'รวมเงิน' },
                        value : { text : this.data.body.total.total }
                    },
                    cash : {
                        label : { text : 'รับเงินสด' },
                        value : { text : this.data.body.total.cash }
                    },
                    change : {
                        label : { text : 'ทอน' },
                        value : { text : this.data.body.total.change }
                    },
                    realTotal : {
                        label : { text : 'มูลค่าสินค้า' },
                        value : { text : this.data.body.total.realTotal }
                    },
                    tax : {
                        label : { text : 'ภาษี' },
                        value : { text : this.data.body.total.tax }
                    }
                }
            },
            footer : {
                note : { text : this.data.footer.note, alignment : 'center' }
            }
        };

        // กำหนดขนาดของแต่ละส่วน ในเอกสาร
        // * หมายถึง auto
        // อ้างอิงขนาดเอกสารได้จาก zpringSize
        this.size = {
            header : {
                head : {
                    logo : {
                        width: 70
                    },
                    detail : {
                        width : '*'
                    }
                },
                info : {
                    company : {
                        width: (this.page.pageSizePoint.width / 2) + 0
                    },
                    receipt : {
                        width: (this.page.pageSizePoint.width / 2) - 0
                    }
                }
            },
                body : {
                order : {
                    detail : { width : (50 * this.page.pageSizePoint.width) / 100 },
                    quantity : { width : '12%' },
                    price : {
                        unit : { width : '17%' },
                        total : { width : '*' }
                    } 
                },
                total : {
                    label : {
                        width : '*'
                    },
                    value : {
                        width : '*'
                    }
                }
            },
            footer : {
                height : this.page.pageMargin.bottom
            }
        };


        // กำหนดรูปร่าง Layout
        this.layout = {
            header : '',
            body : '',
            footer : ''
        };

        
        // เมื่อสร้างเอกสาร จะทำการ Load Font เข้าสู่ canvas 
        // เมื่อทำการโหลดเสร็จ จะทำการ สร้าง Layout เอกสารแล้ว ส่งคืนให้เป็น Promise
        return new Promise(function(resolve, reject) {
            utilB.loadFont(self.typeface).then(function() {

                // เช็คขนาดภาพก่อน
                utilB.imageSize(self.data.header.head.logo).then(function(size) {

                        // หาความสูงของภาพที่ถูก Resize
                        var ratio = size.width / size.height;
                        self.size.header.head.logo.height = self.size.header.head.logo.width / ratio;

                        // สร้าง Layout Body เป็น array
                        self.layout.body = [];
                        
                        // ใส่ Header
                        self.layout.body.push(utilW.header_80m(self.size.header, self.dataMap.header, self.font));

                        // ใส่เส้นขั้น
                        self.layout.body.push(utilW.hrLine(self.page.pageSizePoint.width, { margin : [0, 4] }));

                        // ใส่ตาราง Order
                        self.layout.body.push(utilW.orderTable_80m(self.size.body.order, self.dataMap.body.order, self.font));

                        // ใส่เส้นขั้น
                        self.layout.body.push(utilW.hrLine(self.page.pageSizePoint.width, { margin : [0, 4] }));

                        // ใส่ตาราง Total
                        self.layout.body.push(utilW.total_80m(self.size.body.total, self.dataMap.body.total, self.font));

                        // ใส่เส้นขั้น
                        self.layout.body.push(utilW.hrLine(self.page.pageSizePoint.width, { margin : [0, 4] }));

                        // ใส่ Footer
                        self.layout.body.push(utilW.footer_80m(self.page.pageSizePoint.width, self.dataMap.footer.note, self.font));

                        // คำนวนตวามยาวทั้งเอกสาร เพื่อที่จะคำนวนความสูงของกระดาษ
                        self.page.pageSize.height += self.page.pageMargin.top + self.page.pageMargin.bottom;
                        self.layout.body.forEach(function(obj) {
                            self.page.pageSize.height += obj.cal_height;
                        });

                        // แจ้ง Promise ว่าทำเสร็จหมดแล้ว
                        resolve(self);

                    }
                );
                
            });
        });

    }

};